(82, 'Javed Ur Rehman', 'javed@allphptricks.com', 'Advice and Consideration for Shifting of Course', '<p>Dear Ma\'am&nbsp;Jinayon,</p>\r\n<p>I trust this letter finds you in good health and spirits. My name is Kap Nino, and I am reaching out to discuss a matter of personal and academic significance.</p>\r\n<p>It has come to my attention that you are currently pursuing BS-IT at MSU-IIT. While I understand that each academic journey is unique and deeply personal, I wish to express my thoughts regarding the possibility of considering a shift in your course of study.</p>\r\n<p>[Provide specific reasons or observations that lead you to suggest the shift. It could be personal aptitude, career goals, or a genuine belief that another field might align better with the individual\'s interests and strengths.]</p>\r\n<p>I firmly believe that one\'s academic path should be a source of fulfillment and growth, and I encourage you to reflect upon your own aspirations and objectives. Sometimes, a change in course can open new doors and present opportunities that align more closely with one\'s passion and long-term goals.</p>\r\n<p>Should you decide to explore this possibility further, I recommend scheduling a meeting with your academic advisor or the relevant department head to discuss the logistics of such a transition. They can provide valuable insights, guidance, and support to ensure a smooth process.</p>\r\n<p>Remember, it is never too late to make adjustments that lead to a more fulfilling academic and professional journey. Your happiness and success are paramount, and I am confident that, with careful consideration, you will make the decision that best aligns with your aspirations.</p>\r\n<p>If you wish to discuss this matter further or seek additional guidance, please feel free to reach out. I am here to offer support and assistance in any way possible.</p>\r\n<p>Wishing you the very best in your academic endeavors and future pursuits.</p>\r\n<p>Sincerely,</p>\r\n<p style=\"line-height: 1;\">Kap Nino Barzaga</p>\r\n<p style=\"line-height: 1;\">1969-1969</p>', NULL, 'samuelpaul.jinayon@g.msuiit.edu.ph', '2024-01-31 18:08:53', '2024-02-01 23:55:06', NULL, 1),
