(91, 'Syed Ahsan Kamal', 'ahsan@allphptricks.com', 'Where to Eat in Iligan City', '<p>Philippine cities, Luzon to Mindanao, have their share of local restaurants you can try that flare with their dishes fused with other cuisines. Iligan City, Lanao Del Norte has also its set of restaurants from diners, dessert places, burger joints, and coffee houses.</p>\r\n<p>After conquering the numerous waterfalls scattered around the vicinity of Iligan, food is the first thing you will seek when you return to the city proper. Here\'s a list of five restaurants to visit in the City of Majestic Waterfalls.</p>\r\n<h3><strong>Iliganon\'s Cafe</strong></h3>\r\n<p>With its name that signifies the notion of being a true Iliganon, it serves an array of food choices from rice meals, noodles, appetizers (some are sizzlers), and pizza. But the house specialty is randang: beef, fish, and chicken. They have a note that the randang being served has a \"high level of spiciness\".</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Iliganon.jpg\" alt=\"Bisita Iligan - Iliganon\"></p>', NULL, 'javed@allphptricks.com', '2024-02-01 23:27:20', '2024-02-02 00:24:36', NULL, 1),
(93, 'Mohammad Jibreel Y. Hamdain', 'javed@allphptricks.com', 'Testing', 'TestingTestingTestingTestingTestingTesting', 'Mohammad Jibreel Y. Hamdain', 'javed@allphptricks.com', '2024-02-02 00:23:23', '2024-02-02 00:24:36', NULL, 1),
(94, 'Mohammad Jibreel Y. Hamdain', 'javed@allphptricks.com', 'Testing', '<p>Bestsellers include the chicken inasal in petso (thigh) and paa (legs) with the enticing unlimited rice offer, the liempo which was used in the branding of the food house and of course, the hefty Halo-Halo sa Buko. Forget the grilled chicken because you can have it anywhere but don\'t ever skip their Liempo de Lechon, considered as the best one in Mindanao. The well-seasoned liempo is being hyped with a crunchy pork skin perfect for a spicy soy-vinegar sauce.</p>', NULL, 'nissijeap@gmail.com', '2024-02-02 00:25:36', '2024-02-02 00:25:36', NULL, 0);

