(78, 'Nissi Mini Cup Noodles Seafood 40g', 'banner_1706491144.png', 'logo_1706491144.png', '<p>&nbsp;Nissi Mini Cup Noodles Seafood 40g&nbsp;Nissi Mini Cup Noodles Seafood 40g&nbsp;Nissi Mini C&nbsp;Nissi Mini Cup Noodles Seafood 40g&nbsp;Nissi Mini Cup Noodles Seafood 40g&nbsp;Nissi Mini Cup Noodles Seafood 40gup Noodles Seafood 40g</p>', 4, '2024-01-28 17:19:04', '2024-02-01 22:06:34', 1, 5),
(79, 'Nissi Mini Cup Noodles Seafood 40g', 'banner_1706496790.jpg', 'logo_1706496790.jpg', '<p>Philippine cities, Luzon to Mindanao, have their share of local restaurants you can try that flare with their dishes fused with other cuisines. Iligan City, Lanao Del Norte has also its set of restaurants from diners, dessert places, burger joints, and coffee houses.</p>\r\n<p>After conquering the numerous waterfalls scattered around the vicinity of Iligan, food is the first thing you will seek when you return to the city proper. Here\'s a list of five restaurants to visit in the City of Majestic Waterfalls.</p>\r\n<h3><strong>Iliganon\'s Cafe</strong></h3>\r\n<p>With its name that signifies the notion of being a true Iliganon, it serves an array of food choices from rice meals, noodles, appetizers (some are sizzlers), and pizza. But the house specialty is randang: beef, fish, and chicken. They have a note that the randang being served has a \"high level of spiciness\".</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Iliganon.jpg\" alt=\"Bisita Iligan - Iliganon\"></p>\r\n<h3><strong>Tita Fannies Liempo and Chicken House</strong></h3>\r\n<p>Thanks to a food chain for bringing the famous \"chicken inasal\" within the reach of every Filipino in any part of the country. Before that, Iliganon\'s were already enjoying this meal in their locality courtesy of Tita Fannies Liempo and Chicken House.</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Tita%20Fannies.jpg\" alt=\"Bisita Iligan - Tita Fannies\"></p>\r\n<p>Bestsellers include the chicken inasal in petso (thigh) and paa (legs) with the enticing unlimited rice offer, the liempo which was used in the branding of the food house and of course, the hefty Halo-Halo sa Buko. Forget the grilled chicken because you can have it anywhere but don\'t ever skip their Liempo de Lechon, considered as the best one in Mindanao. The well-seasoned liempo is being hyped with a crunchy pork skin perfect for a spicy soy-vinegar sauce.</p>\r\n<p>You can end your meal in Tita Fannies by having a serving of their Halo-Halo sa Buko, which is actually for sharing. The buko (coconut) shell was filled generously with gulaman, some beans, banana, coconut meat, topped with a scoop of ube ice cream, and sprinkled with rice crisps.</p>\r\n<h3><strong>Delecta\'s Diner and Cafe</strong></h3>\r\n<p>A famous diner, already on its decades, is a place that Iliganon kids in the \'90s grew up with, Delecta\'s Diner and Cafe located at the heart of the city center. After an early and grueling trek to see the falls in the northeastern part, Delecta\'s Diner and Cafe is the perfect place to have some gastronomical adventure.</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Delecta.jpg\" alt=\"Bisita Iligan - Delecta\"></p>\r\n<h3><strong>Flamoo\'s Flamed-Grilled Burgers</strong></h3>\r\n<p>Flamoo Burgers is now gaining popularity as Iligan\'s best burger house. Located on the grounds of Calda, The Strip, it offers a nice hang-out for the family on the weekends, teenagers in late afternoons, and some night get-togethers for yuppies. The Strip is like a large open field for children to run around, old friends to get together, and big families to have bonding time. Flamoo sits invitingly here and fits perfectly well at a corner of this big spacious lawn. And when the natural lights dim out, and the stars peek out, it is when still hot burgers and really cold beer marries well together with laughter trying to fill up space to no avail.</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Flamoo.jpg\" alt=\"Bisita Iligan - Flamoo\"></p>\r\n<h3><strong>Latino\'s Diner and Cafe</strong></h3>\r\n<p>Latino\'s Diner Cafe is another addition to the growing family of \'homegrown<em>\'</em>&nbsp;restaurants in Iligan. Having local food hubs amidst the mushrooming foreign franchise is worth celebrating.</p>\r\n<p>Although it does not offer Latin American cuisine, it caters extensive selection of Filipino dishes and pastries.</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Latinos.jpg\" alt=\"Bisita Iligan - Latinos\"></p>\r\n<p><strong>Source</strong>:&nbsp;<a href=\"http://www.rjdexplorer.com/where-to-eat-in-iligan-city-lanao-del-norte/\">http://www.rjdexplorer.com/where-to-eat-in-iligan-city-lanao-del-norte/</a></p>', 4, '2024-01-28 18:53:10', '2024-02-01 21:29:32', 1, 5),
(80, 'Nissi Mini Cup Noodles Seafood 40g', 'banner_1706497146.jpg', 'logo_1706497146.jpg', '<p>Philippine cities, Luzon to Mindanao, have their share of local restaurants you can try that flare with their dishes fused with other cuisines. Iligan City, Lanao Del Norte has also its set of restaurants from diners, dessert places, burger joints, and coffee houses.</p>\r\n<p>After conquering the numerous waterfalls scattered around the vicinity of Iligan, food is the first thing you will seek when you return to the city proper. Here\'s a list of five restaurants to visit in the City of Majestic Waterfalls.</p>\r\n<h3><strong>Flamoo\'s Flamed-Grilled Burgers</strong></h3>\r\n<p>Flamoo Burgers is now gaining popularity as Iligan\'s best burger house. Located on the grounds of Calda, The Strip, it offers a nice hang-out for the family on the weekends, teenagers in late afternoons, and some night get-togethers for yuppies. The Strip is like a large open field for children to run around, old friends to get together, and big families to have bonding time. Flamoo sits invitingly here and fits perfectly well at a corner of this big spacious lawn. And when the natural lights dim out, and the stars peek out, it is when still hot burgers and really cold beer marries well together with laughter trying to fill up space to no avail.</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Flamoo.jpg\" alt=\"Bisita Iligan - Flamoo\"></p>\r\n<h3><strong>Latino\'s Diner and Cafe</strong></h3>\r\n<p>Latino\'s Diner Cafe is another addition to the growing family of \'homegrown<em>\'</em>&nbsp;restaurants in Iligan. Having local food hubs amidst the mushrooming foreign franchise is worth celebrating.</p>\r\n<p>Although it does not offer Latin American cuisine, it caters extensive selection of Filipino dishes and pastries.</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Latinos.jpg\" alt=\"Bisita Iligan - Latinos\"></p>