(93, 'Princess Nissi Jea Cup Noodles Paglinawan Nga Nagpuyo sa Tibanga Katong Pakurbada nga naay medical man siguro tas atbang ug al pater kuwait', 'banner_1706687683.jpg', 'logo_1706687683.jpg', '<p>Time Ago Function is a function that is commonly used to display time in human understandable format, as you have seen many times on social networks, whenever you post any status on your Facebook, Twitter or any other network, it says posted few seconds ago, 1 min ago, 1 hour age, etc. This is actually done by subtracting the post published time from the current time.</p>\r\n<p>For this purpose we need to store a date in database, date should be in MySQL standard date and time format (&ldquo;Y-m-d H:i:s&rdquo;).</p>', NULL, '2024-01-30 23:54:43', '2024-02-01 23:16:55', 1, 8),
(94, 'Ang Alamat Ng Funds sa JITS dayun nakaguba ug mop si raymart tas si sam kay nagkacrush ni LQ', 'banner_1706764746.gif', 'logo_1706767333.png', '<p>Test</p>', NULL, '2024-01-31 00:34:43', '2024-02-01 21:35:01', 1, 8),
(97, 'Whispers of the Celestial Union ni Jucille nga gapuyo sa sta.filomena duol sa toyota nga car dealership', 'banner_1706773874.gif', 'logo_1706770816.jpg', '<p>Once upon a time, in the celestial realms of&nbsp;Etheria and Terrania, two worlds existed in perfect harmony. Etheria, a realm of shimmering stars and ethereal beauty, was governed by the Moonlit Council, while Terrania, a lush land of vibrant colors and diverse landscapes, was ruled by the Sunfire Monarchy. The two worlds coexisted peacefully, their inhabitants unaware of the extraordinary connection that bound them.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"2c6465f406fe78a4dcbb9ee898793b26.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"473\" height=\"266\"></p>\r\n<p>In Etheria, there lived a radiant moonbeam named Seraphina, known for her enchanting glow and gentle spirit. In Terrania, a fiery sunbeam named Solarius exuded warmth and vitality. Ages ago, these two beings had shared a profound love that transcended their worlds. However, a cosmic force had separated them, casting each into their respective realms.</p>\r\n<p>As centuries passed, the memories of their love lingered in the hearts of Seraphina and Solarius, like echoes from a distant dream. Unbeknownst to them, the celestial bodies began to align in a rare cosmic dance that opened a portal between Etheria and Terrania. The Moonlit Council and the Sunfire Monarchy sensed a mysterious force at play, and the once-stable equilibrium of their worlds began to tremble.</p>\r\n<p>In the midst of celestial unrest, Seraphina and Solarius felt an irresistible pull drawing them towards the portal. Guided by the echoes of their love, they embarked on a quest to reunite and restore balance to their worlds. The journey was perilous, as they traversed landscapes filled with magical creatures, crossed celestial rivers, and faced trials that tested the strength of their love.</p>\r\n<p>As they ventured deeper into the unknown, Seraphina and Solarius discovered clues left behind by ancient celestial beings, guiding them towards the heart of the cosmic convergence. Along the way, they encountered beings from both realms, who, inspired by the power of true love, joined forces to help the star-crossed lovers.</p>\r\n<p>The Moonlit Council and the Sunfire Monarchy, once wary of each other, began to recognize the interconnectedness of their worlds. A fragile alliance formed as they witnessed the harmony that could exist between Etheria and Terrania.</p>\r\n<p>Finally, at the epicenter of the cosmic convergence, Seraphina and Solarius found themselves in a breathtaking celestial garden. The atmosphere shimmered with the hues of both worlds, symbolizing the unity they had longed for. In this ethereal sanctuary, surrounded by the whispers of the celestial union, Seraphina and Solarius embraced, their love rekindled and stronger than ever.</p>\r\n<p>As the lovers reunited, a radiant energy emanated from them, harmonizing the forces of Etheria and Terrania. The portal closed, leaving the two worlds forever entwined, sharing the beauty and magic that each had to offer.</p>\r\n<p>With the cosmic balance restored, Seraphina and Solarius became the eternal guardians of the celestial union, their love transcending time and space. The once-separate worlds of Etheria and Terrania now thrived together, a testament to the enduring power of love that could overcome even the boundaries of the cosmos.</p>', NULL, '2024-01-31 23:00:16', '2024-02-02 00:25:44', 1, 3),
(99, 'Princess Nissi Jeeeng Ballet of the Octopus: Navigating Submarine Spaces with Tap-Dancing Turtles and Time-Traveling Tea', 'banner_1706857420.jpeg', 'logo_1706837950.png', '<div style=\"max-width: 650px;\" data-ephox-embed-iri=\"https://www.youtube.com/watch?v=xDFWLudn5WY\">\r\n<div style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 56.25%;\"><iframe style=\"top: 0; left: 0; width: 100%; height: 100%; position: absolute; border: 0;\" src=\"https://www.youtube.com/embed/xDFWLudn5WY?rel=0\" scrolling=\"no\" allow=\"accelerometer; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share;\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n<p><strong>Story:</strong></p>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div data-testid=\"conversation-turn-29\">\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div data-message-id=\"45e48b3a-3ca4-4787-8cc9-15a6e4d2d0d9\" data-message-author-role=\"assistant\">\r\n<div>\r\n<p>Once upon a time in a whimsical underwater kingdom called Aquatopia, there lived a peculiar princess named Nissi Jeeeng. She wasn\'t your typical royal; instead, she possessed a profound curiosity for the extraordinary and the bizarre. The kingdom was known for its vibrant marine life, enchanting coral castles, and a sense of wonder that filled the water with magic.</p>\r\n<p>One day, Princess Nissi Jeeeng stumbled upon an ancient book hidden within the royal library. Its title, \"Ballet of the Octopus: Navigating Submarine Spaces with Tap-Dancing Turtles and Time-Traveling Tea,\" immediately caught her attention. The book was said to hold the secrets of a mystical journey through uncharted submarine realms, guided by the rhythmic dance of underwater creatures and a cup of extraordinary time-traveling tea.</p>\r\n<p>Intrigued by the possibilities, Princess Nissi Jeeeng embarked on a quest to unravel the mysteries within the pages of the ancient book. She sought out the kingdom\'s wise octopus, Sir Octavio, known for his extensive knowledge of the underwater world. Sir Octavio, with his eight graceful arms, agreed to guide the adventurous princess on this extraordinary journey.</p>\r\n<p>Their underwater adventure began in the luminescent depths of the Aquatopian Sea. As they ventured deeper, they encountered tap-dancing turtles who moved to the beat of the ocean currents. Princess Nissi Jeeeng, enchanted by their rhythmic movements, joined in the dance, creating a symphony of elegance beneath the waves.</p>\r\n<p>The journey continued through coral archways and mysterious caverns, where time seemed to bend and twist. It was during one of these twists that the princess discovered the magical time-traveling tea. Brewed from a unique blend of rare seaweeds and enchanted herbs, the tea had the power to transport them to different eras and realms within the aquatic universe.</p>\r\n<p>As they sipped the enchanted tea, Princess Nissi Jeeeng and Sir Octavio found themselves surrounded by historical wonders. They witnessed the creation of ancient coral kingdoms, danced with mermaid societies, and even attended an underwater masquerade ball hosted by wise old seahorses.</p>\r\n<p>However, their journey wasn\'t without challenges. They encountered mischievous sea creatures, deep-sea riddles, and the occasional whirlpool that threatened to disrupt their enchanting expedition. But with each challenge, Princess Nissi Jeeeng and Sir Octavio faced it with courage and a touch of underwater ballet.</p>\r\n<p>Through their extraordinary adventure, Princess Nissi Jeeeng learned the importance of embracing curiosity, dancing to the rhythm of life, and savoring the magical moments that time-traveling tea could offer. As they returned to the surface, the princess brought back tales of her underwater odyssey, spreading wonder and joy throughout the kingdom of Aquatopia.</p>\r\n<p>And so, the legend of Princess Nissi Jeeeng\'s Ballet of the Octopus became a cherished story, inspiring generations to come with the magic that lies beneath the surface and the beauty found in the most unexpected places.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<div><button></button>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div><form>\r\n<div>\r\n<div>&nbsp;</div>\r\n</div>\r\n</form></div>', NULL, '2024-02-01 17:39:10', '2024-02-02 00:44:41', 1, 5),
(100, 'Where to Eat in Iligan City', 'banner_1706861859.jpg', 'logo_1706861859.png', '<p>Philippine cities, Luzon to Mindanao, have their share of local restaurants you can try that flare with their dishes fused with other cuisines. Iligan City, Lanao Del Norte has also its set of restaurants from diners, dessert places, burger joints, and coffee houses.</p>\r\n<p>After conquering the numerous waterfalls scattered around the vicinity of Iligan, food is the first thing you will seek when you return to the city proper. Here\'s a list of five restaurants to visit in the City of Majestic Waterfalls.</p>\r\n<h3><strong>Iliganon\'s Cafe</strong></h3>\r\n<p>With its name that signifies the notion of being a true Iliganon, it serves an array of food choices from rice meals, noodles, appetizers (some are sizzlers), and pizza. But the house specialty is randang: beef, fish, and chicken. They have a note that the randang being served has a \"high level of spiciness\".</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Iliganon.jpg\" alt=\"Bisita Iligan - Iliganon\"></p>\r\n<h3><strong>Tita Fannies Liempo and Chicken House</strong></h3>\r\n<p>Thanks to a food chain for bringing the famous \"chicken inasal\" within the reach of every Filipino in any part of the country. Before that, Iliganon\'s were already enjoying this meal in their locality courtesy of Tita Fannies Liempo and Chicken House.</p>\r\n<p><img src=\"https://www.bisitailigan.com/storage/photos/1/Bisita%20Iligan%20-%20Tita%20Fannies.jpg\" alt=\"Bisita Iligan - Tita Fannies\"></p>\r\n<p>Bestsellers include the chicken inasal in petso (thigh) and paa (legs) with the enticing unlimited rice offer, the liempo which was used in the branding of the food house and of course, the hefty Halo-Halo sa Buko. Forget the grilled chicken because you can have it anywhere but don\'t ever skip their Liempo de Lechon, considered as the best one in Mindanao. The well-seasoned liempo is being hyped with a crunchy pork skin perfect for a spicy soy-vinegar sauce.</p>', 6, '2024-02-02 00:17:39', '2024-02-02 00:41:03', 1, 4),
(101, 'Testing Oreo', 'banner_1706863443.png', 'logo_1706863443.png', '<p><a href=\"https://www.youtube.com/watch?v=m9coOXt5nuw\">https://www.youtube.com/watch?v=m9coOXt5nuw</a></p>', 2, '2024-02-02 00:44:03', '2024-02-02 00:44:30', 1, 4);

